import React from 'react';
import CardData from './CardInfo';
import './index.css';

const Card=({cardInfo})=>{
   //console.log(props);
   //const entries = Object.entries(props);
   //console.log(entries);
    return(
        <>
            {cardInfo.map((item)=>{
                const {id, Image, Category, Title, Link} = item;
                console.log(id);
                console.log(Image);
                console.log(Category);
                console.log(Title);
                console.log(Link);
            //console.log(item);
                return(
                    <>
                        <div className='cards' key={id}>
                            <div className='card' key={id}>
                                <img src={Image} alt='Movie photo' />
                                <div className='cardInfo' key={id}>
                                    <span className='category'>{Category}</span>
                                    <h3 className='title'>{Title}</h3>
                                    <a href={Link} target='_blank'>
                                        <button type="button">Watch Now</button>
                                    </a>
                                </div>
                            </div>
                        </div>

                    </>
                )
            })}
            
        </>

    );

}

export default Card;
